import React, {Component} from 'react';

import './Moi.css';

class Moi extends Component {

  typeWriter(s) {
    for (let i = 0; i < s.length; i++) {
      let time = setTimeout(() => {
        document.querySelector('.type-writer').innerHTML += s.charAt(i);
        console.log(s.charAt(i));
        clearTimeout(time);
      }, 2000);
    }
  }

  componentDidMount() {
    this.typeWriter("Moi pdfoj");
  }

  render() {
    return (<div id="moi">
      <h1 className="type-writer title"></h1>
    </div>);
  }
}

export default Moi;
